import React from 'react';
import { GoogleMap, withScriptjs, withGoogleMap } from 'react-google-maps';

 function Map() {
     return (
         <GoogleMap 
            defaultZoom={10}
            defaultCenter={{ lat: 51.497730, lng: -0.079720}}
        />
     );
 }

 const WrappedMap = withScriptjs(withGoogleMap(Map));


 export default Map;
